import Head from 'next/head';
import Toolbar from './toolbar';
import Footer from './footer';

const Layout = (props) => (
    <>
        <Toolbar token={props.token} logout={props.logoutClickHandler} />
        {props.childrens}
        <Footer />
    </>
);

export default Layout;
